import React from 'react';
import { connect } from 'react-redux';
import { Link, withRouter } from 'react-router-dom';
import { signOut } from '../../actions/signin';
import { Button } from 'semantic-ui-react';
import './Navigation.css';

class Navigation extends React.Component {
	onSignOutClick = (formValues) => {
		this.props.signOut(this.props.history)
	}
	render() {
		if (this.props.authenticated === true){
			return (
				<div className="navigation">
					<Button onClick={ this.onSignOutClick }>Sign Out</Button>
				</div>
			);
		} else {
			return (
				<div className="navigation">
					<Link to='/'>
						<Button color='teal'>Home</Button>
					</Link>
					<Link to='/register'>
						<Button color='blue'className="login-button">Register</Button>
					</Link>
					<Link to='/signin'>
						<Button className="login-button">Sign In</Button>
					</Link>	
				</div>
			);
		}
	}
};

const mapStateToProps = (state) => {
	return{
		authenticated: state.signIn.authenticated
	}
}

export default withRouter(connect(mapStateToProps, { signOut })(Navigation));
